function initMultiTextFieldPicker(e){if(e){var t=e.id,n=JSON.parse(e.dataset.selectedvalues||"[]"),i=JSON.parse(e.dataset.options||"[]"),u=Vue.component("vue-multiselect",window.VueMultiselect.default),a=new CustomEvent("multitextfield-picker-created",{detail:{vm:new Vue({el:"#"+t,components:{"vue-multiselect":u},data:{value:n,options:i,valuesKey:e.dataset.valueskey},watch:{value:function(){setTimeout(function(){document.dispatchEvent(new Event("contentpreview:render"))},100)}}})}});document.body.dispatchEvent(a)}}